import React from "react";

function Card({ Series }) {
	return (
		<div className="container">
			{Series.map((Serie) => (
				<div className="Card">
					<img src={Serie.url} alt="Pic of the Serie" />
					<div className="info">
						<h2 key={Serie.id}>
							{" "}
							{Serie.id} {" : "}
							{Serie.title}{" "}
						</h2>
						<p> {Serie.description}</p>
					</div>
				</div>
			))}
		</div>
	);
}

export default Card;
